import s from './Post.module.css';
import MyPosts from "../MyPosts";


const Post = (props) => {
    return (
        <div className={s.posts}>
            <img className={s.imgPost} src='/img/freddie2.jpeg'/>
            <h3 className={s.item}>{props.text}</h3>
        </div>
    )
}

export default Post;
